import React, { useEffect, useState } from 'react';
import './HomePage.css';
import SimpleImageSlider from 'react-simple-image-slider';

export default function HomePage() {
  const sliderImages = [    {      url: 'images/hp1.jpg',    },    {      url: 'images/hp2.jpg',    },    {      url: 'images/16.jpg',    },  ];

  const testimonials = [    {      id: 1,      text: "We have been using SunTec's services for the past year to tag products with qualitative attributes. Their work has been pivotal in us being able to deploy new products that leverage the data that their team has provided. They have been super helpful, responsive, and diligent in the work that they've provided. We look forward to maintaining our relationship for the long term",      author: 'John Slith',      jobTitle: 'CEO',    },    {      id: 2,      text: "I am pleased with the services SunTec has provided me to modify the design and functionality of my online shopping website. Its X-Cart development services helped my online business grow. I would really like to work with SunTec again.",      author: 'Jane Smith',      jobTitle: 'Marketing Manager',    },    {      id: 3,      text: "I was looking for Zen Cart Development service for my business. After surveying many companies, the search ended with SunTec India. I was really impressed with the way they catered to my requirements. They provided me cost-effective solutions, and I hope to work with them in the near future.",      author: 'Mane Smith',      jobTitle: 'Business Owner',    },  ];

  return (
    <div className="home">
      <h1>MY SHOP</h1>

      <div className="banner">
        <SimpleImageSlider
          width={1848}
          height={700}
          images={sliderImages}
          showNavs={true}
          slideDuration={0.8}
          autoPlay={true}
        />
        <h2>
          Let us help you reach your audience. We are a digital marketing agency in Bhubaneswar that handles all your online broadcasting strategies for better reach to a broader range of audience. We communicate your business with most compelling marketing strategies and creative ideas.
        </h2>
      </div>

      <div className="services">
        <h1>Our Services</h1>
        <ul>
          <li>
            <img src="images/1.jpg" alt="Service 1" />
            <h4>Search Engine Optimization</h4>
            <p>
              We use the latest techniques and tools to improve the ranking of your website in search engine results pages.
            </p>
          </li>
          <li>
            <img src="images/service2.jpg" alt="Service 2" />
            <h4>Social Media Marketing</h4>
            <p>
              We create engaging and relevant content for your social media accounts to build a strong online presence for your brand.
            </p>
          </li>
          <li>
            <img src="images/service3.jpg" alt="Service 3" />
            <h4>Email Marketing</h4>
            <p>
              We design and execute email marketing campaigns that target the right audience and achieve high conversion rates.
            </p>
          </li>
        </ul>
      </div>
      </div>
  );}

